//import React from 'react'
import Button  from './Button'

import PropTypes from 'prop-types'

const Header = ({title}) => {
    const onClick =()=>{
        console.log('new');
    }

    return (
           <header class="header">
             <h1>{title}</h1>

           <Button color ='green' text ='Add' onClick={onClick} ></Button>
           <Button color ='yellow' text ='Cancle' onClick={onClick} ></Button>
           </header>


    )
}
Header.defaultPorps ={
    title :'new',
}
